import React, {useState} from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';

function Register() {
    const [fullName, setfullName] =useState('');
    const [username, setusername] =useState('');
    const [email, setemail] =useState('');
    const [IDNumber, setIDNumber] =useState('');
    const [accountNumber, setaccountNumber] =useState('');
    const [password, setpassword] =useState('');
    const [error, setError] =useState('');
    const navigate = useNavigate();

    const handleSubmit = async (e) => {
        e.preventDefault();
        setError('');

        try{
            const response = await axios.post('http://localhost:5000/api/auth/register', {fullName, username, email, IDNumber, accountNumber, password});
            if (response.status === 201) {
                navigate('/');
            }
        }catch (err){
            if (err.response) {
                setError(err.response.data.message);
            }else {
                setError('Something went wrong. Please try again.');
            }
        }
    }

    return(
        <div>
            <h1>Register</h1>
            <form onSubmit={handleSubmit}>
                <label htmlFor= "fullName">FullName</label>
                <input type= "text" id= "fullName" value={fullName} onChange={e => setfullName(e.target.value)} required autoComplete="true"/>
                <label htmlFor="username">Username</label>
                <input type= "text" id= "username" value={username} onChange={e => setusername(e.target.value)} required autoComplete="true"/>
                <label htmlFor="email">Email</label>
                <input type= "text" id= "email" value={email} onChange={e => setemail(e.target.value)} required autoComplete="true"/>
                <label htmlFor="IDNumber">ID Number</label>
                <input type= "text" id= "IDNumber" value={IDNumber} onChange={e => setIDNumber(e.target.value)} required autoComplete="true"/>
                <label htmlFor="accountNumber">Account Number</label>
                <input type= "text" id= "accountNumber" value={accountNumber} onChange={e => setaccountNumber(e.target.value)} required autoComplete="true"/>
                <label htmlFor="password">Password</label>
                <input type= "password" id= "password" value={password} onChange={e => setpassword(e.target.value)} required/>
                {error && <p style={{color: 'red'}}>{error}</p>}
                <button type='submit'>Register</button>
            </form>
        </div>
    );
}

export default Register;
